			var b21 = minTOI.s2.body;
			if(!b11.sweepFrozen) {
				b11.sweepIntegrate(curTimeAlpha * deltaTime);
				b11.sweepValidate(minTOI.s1);
			}
			if(!b21.sweepFrozen) {
				b21.sweepIntegrate(curTimeAlpha * deltaTime);
				b21.sweepValidate(minTOI.s2);
			}
			var wasnull = minTOI.arbiter == null;
